import SignUp from "./features/auth/register/SignUp";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import Login from "./features/auth/login/Login";
import AdminHome from "./features/dashboards/adminHome/AdminHome";
import SideBar from "./features/dashboards/sideBar/SideBar";
import SetTime from "./features/dashboards/attendanceTime/SetTime";
import GenerateNativeAttendance from "./features/dashboards/native'sAttendanceReport/Natives'sAttendanceReport"
// import NativeAttendanceReports from "./features/dashboards/native'sAttendanceReport/Natives'sAttendanceReport";


function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<SignUp />} />
        <Route path="/adminHome" element={<AdminHome />} />
        <Route path="/setAttendanceTime" element={<SetTime />} />
        <Route path="/login" element={<Login />} />
        <Route path="/signup" element={<SignUp />} />
        <Route path="/sideBar" element={<SideBar />} />
        <Route
          path="/generateNativeAttendanceReport"
          element={<GenerateNativeAttendance />}
        />
      </Routes>
    </Router>
  );
}

export default App;
